text:
"What you're seeing there is very similar to what we saw in Biloxi. Everything's leveled to the ground."
@ltgrusselhonore, who commanded the military response to Hurricane Katrina, on Hurricane Dorian's impact on Great Abaco Island in the Bahamas.  
